import React from "react";

// Images
import Logo from "../../images/common/logo.svg";
import Search from "../../images/common/search.svg"
import LogoRight from "../../images/common/logoRight.svg";

const Header = () => {
  return (
    <div className="container-fluid d-flex justify-content-between align-items-center headerBox">
      <img src={Logo} alt="Logo" />
      <img src={Search} alt="Logo" />

      <img src={LogoRight} alt="Logo Right" />
    </div>
  );
};

export default Header;
